import React from 'react';

const MyComponent = () => {
  return (
    <div className="p-4 bg-blue-500 text-white">
      <h1 className="text-2xl font-bold">Hello, Tailwind CSS!</h1>
      <p>This is a component styled with Tailwind CSS.</p>
    </div>
  );
};

export default MyComponent;
